		"id": 848889119082139600,
		"id_str": "848889119082139648",
		"text": "아무리 포장을 해도 死표는 사표야… 당신의 사표는 절대로 부활하지 않는다.\n\n↑ 내가 이런 이유로 현타를 느꼈던 것이 벌써 10년 전임. 이를 극복하고 나의 정치관과 투표 성향을 현실적으로 바꿨고, 그렇게 되자 내가 원하는 정책이 반영되기 시작하더라.",
