		"id": 848887933608185900,
		"id_str": "848887933608185856",
		"text": "어떠한 정책이 반영되는 것은 결과를 뻔히 알면서도 소신투표라는 이름으로 사표를 낸 사람들 때문이 아니라- 자기가 지지하는 후보자를 당선시킨 지지자들이 지분을 가지고 자기 당선자에게 그러한 정책을 요구했기 때문이라고 생각. 그리고 아마도 그게 사실일걸…",
