		"text": "어차피 당선 가능성 없다고 생각하니 그저 듣기 좋은- 하지만 현실성 없는 허황된 말들을 공약으로 내세워 지지자를 끌어모으지만 그에 대한 책임은 지지 않는다. 어차피 그런 사리분별이 되지 않는 이들이니 그걸 믿고 지지하는거고, 낙선하면 안지켜도 되니까…",
