		"text": "지지율이 한 줌도 안되고 당선권에서 안드로메다로 먼 후보들까지 어케 다 한자리에 앉혀놓고 토론을 시키나. 시간 낭비지… 근데 지지율 낮고 끝까지 완주한다는 후보들 모아놓고 토론 시키면 뭐 허경영 이런 사람들까지 다 모여 난장예능 되는 재미는 있겠네ㅎㅎ",
